Getting started
What is typegql?
typegql is set of decorators allowing creating GraphQL APIs quickly and in type-safe way.
Creating very simple schema
Schema is main building block of any graphql schema. It'll join all parts of our api together.
In typegql to create schema, we need to pass class decorated with @Schema to compileSchema function
import { Schema, compileSchema} from 'typegql

@Schema()
class SuperSchema {
  // fields implementation
}

const compiledSchema = compileSchema(SuperSchema);

compiledSchema from example above is standard, regular graphql schema.
Adding Query and Mutation fields
Any working schema requires at least one Query field. There are special decorators - @Query and @Mutation used to register root fields of schema.
Very simple fully working schema like
{
  hello # will resolve to 'world'
}

Could be implemented as:
import { Schema, Query, compileSchema} from 'typegql

@Schema()
class SuperSchema {
  @Query()
  hello(): string {
    return 'world'
  }
}

const compiledSchema = compileSchema(SuperSchema);

Adding parameters
Let's add some customization to our schema:
{
  hello(name: "Bob") # will resolve to 'Hello, Bob!'
}

With tiny change in our code:
import { Schema, Query, compileSchema} from 'typegql

@Schema()
class SuperSchema {
  @Query()
  hello(name: string): string {
    return `Hello, ${name}!`;
  }
}

const compiledSchema = compileSchema(SuperSchema);

Adding nested types
For now, our query field returned scalar (string). Let's return something more complex. Schema will look like:
mutation {
  createProduct(name: "Chair", price: 99.99) {
    name
    price
    isExpensive
  }
}

Such query will have a bit more code and here it is:
import { Schema, Query, ObjectType, Field, Mutation, compileSchema} from 'typegql;

@ObjectType({ description: 'Simple product object type' })
class Product {
  @Field()
  name: string;

  @Field()
  price: number;

  @Field()
  isExpensive() {
    return this.price > 50;
  }
}

@Schema()
class SuperSchema {
  @Mutation()
  createProduct(name: string, price: number): Product {
    const product = new Product();
    product.name = name;
    product.price = price;
    return product;
  }
}

const compiledSchema = compileSchema(SuperSchema);

Forcing field type.
Since now, typegql was able to guess type of every field from typescript type definitions.
There are, however, some cases where we'd have to define them explicitly.

We want to strictly tell if field is nullable or not
Function we use returns type of Promise while field itself is typed as SomeType
List (Array) type is used. (For now, typescript Reflect api is not able to guess type of single array item. This might change in the future)

Let's modify our Product so it has additional categories field that will return array of strings. For sake of readibility, I'll ommit all fields we've defined previously.
@ObjectType()
class Product {
  @Field({ type: [String] }) // note we can use any native type like GraphQLString!
  categories(): string[] {
    return ['Tables', 'Furniture'];
  }
}

We've added { type: [String] } as @Field options. Type can be anything that is resolvable to GraphQL type

Native JS scalars: String, Number, Boolean.
Any type that is already compiled to graphql eg. GraphQLFloat or any type from external graphql library etc
Every class decorated with @ObjectType
One element array of any of above for list types eg. [String] or [GraphQLFloat]

Writing Asynchroniously
Every field function we write can be async and return Promise. Let's say, instead of hard-coding our categories, we want to fetch it from some external API:
@ObjectType()
class Product {
  @Field({ type: [String] }) // note we can use any native type like GraphQLString!
  async categories(): Promise {
    const categories = await api.fetchCategories();
    return categories.map(cat => cat.name);
  }
}

Adding to your project
Installation and setup
Important! setup steps are simple, but required. Make sure to check setup section.

explore/object-type-and-field.html.body:
Object types
Object types are main building block of any graphql schema. In typegql - ObjectType is equivalent to GraphQLObjectType.
To define new object type, decorate any class with @ObjectType decorator.
import { ObjectType } from 'typegql';

@ObjectType()
class MyType {
  // fields will be defined here
}

Fields
Every ObjectType must have at least one field. To create new field, decorate any property or method of ObjectType class with @Field decorator:
import { ObjectType, Field } from 'typegql';

@ObjectType()
class MyType {
  @Field() foo: string;

  @Field()
  fooMethod(): string {
    return 'fooMethodResult';
  }
}

Nested Sub-types
To build nested structure of objects - every field can use another ObjectType as it's type
import { ObjectType, Field } from 'typegql';

@ObjectType()
class Location {
  constructor(lat: number, lng: number) {
    this.lat = lat;
    this.lng = lng;
  }

  @Field() lat: number;
  @Field() lng: number;
}

@ObjectType()
class Restaurant {
  @Field() name: string;

  @Field()
  location(): Location {
    return new Location(50, 50);
  }
}

Circular type references
In other to define circular references. Eg. car have owner, owner has cars which have owner. it's required to assign types in lazy way (with getter functions)
To do so, we'll use @Field with type option.
import { ObjectType, Field } from 'typegql';

@ObjectType()
class Car {
  @Field({ type: () => Person })
  owner() {
    return db.findPersonByCarId(this.id);
  }
  @Field() id: number;
}

@ObjectType()
class Person {
  @Field() id: number;
  @Field() name: string;
  @Field({ type: () => Car })
  car() {
    return db.findCarByOwnerId(this.id);
  }
}

explore/arg.html.body:
Field arguments
Many of fields in graphql queries use arguments. eg
query {
  calculator {
    add(a: 2, b: 3)
  }
}

Let's create such Calculator object type.
import { ObjectType, Field } from 'typegql';

@ObjectType()
class Calculator {
  @Field()
  add(a: number, b: number): number {
    return a + b;
  }
}

Note we didn't even have to use @Arg decorator yet. In case of simple, scalar argument types like string, number, boolean it's not required. By default arguments not decorated with @Arg are required.
Customizing argumens (eg. adding default value)
Let's say we're building another calculator metod, called pow which returns base to the exponent power (base^exponent). By default, we want exponent to be 2.
import { ObjectType, Field, Arg } from 'typegql';

@ObjectType()
class Calculator {
  @Field()
  pow(
    base: number,
    @Arg({ nullable: true, defaultValue: 2 })
    exponent: number,
  ): number {
    return Math.pow(base, exponent);
  }
}

Right now exponent argument is optional so we can use both:
framgnet A on Calculator {
  pow(2) # 4
}

framgnet B on Calculator {
  pow(2, 5) # 32
}

explore/input-type-and-input-field.html.body:
Complex input types with @InputType and @InputField
Sometimes we need arguments to have complex structure (eg. user have some todos and want to delete few of them using filter) like
query {
  currentUser {
    deleteManyTodos(where: { isDone: true, nameContains: "call my friend" }) {
      deletedCount
    }
  }
}

Let's create such User type that allows complex where argument for deleteManyTodos field.
import { ObjectType, Field, Arg } from 'typegql';

@InputType()
class WhereFilter {
  @InputField({ defaultValue: true })
  isDone: boolean;
  @InputField() nameContains: string;
}

@ObjectType()
class DeleteTodosResult {
  constructor(public deletedCount: number) {}
  @Field() deletedCount: number;
}

@ObjectType()
class User {
  @Field()
  deleteManyTodos(where: WhereFilter): DeleteTodosResult {
    const deletedCount = todosService.remove(where);
    return new DeleteTodosResult(deletedCount);
  }
}

explore/enum/.body:
Enums
For enums we can work with native Typescript enum keyword like
enum TaskType {
  Done,
  InProgress,
  Finished,
  Cancelled,
}

The only thing is required is registering such enum with it's name, so schema compiler is aware of it (as under the hood, enum is plain key-value object).
import { registerEnum } from 'typegql';

enum TaskType {
  Done,
  InProgress,
  Finished,
  Cancelled,
}

registerEnum(TaskType, { name: 'TaskType' });

Now, to use such enum in query like:
query {
  currentUser {
    hasAnyTaskOfType(type: Done)
  }
}

User type would be defined as:
import { ObjectType, Field, registerEnum } from 'typegql';

enum TaskType {
  Done,
  InProgress,
  Finished,
  Cancelled,
}

registerEnum(TaskType, { name: 'TaskType' });

@ObjectType()
class User {
  @Field() id: number;

  @Field()
  hasAnyTaskOfType(type: TaskType): boolean {
    return tasksService.hasTasksOfType(type);
  }
}

