Field resolution hooks
In many cases, it might be desired to perform some aditional action before or after some field is resolved. Most common use-case could be authorization of user.
Hooks are special kind of functions added to field with @Before, @After or @Guard decorator.

@Before and @After
@Guard

explore/hooks/before-and-after.html.body:
@Before and @After hooks
Let's say we want to send informations about useage of some field of our graphql api to analitycs server. We could achieve that with:
import { ObjectType, Field, After } from 'typegql';

@ObjectType()
class Person {
  @Field() id: number;

  @Field()
  @After(() => {
    loggingService.sendLog(`User was removed`);
  })
  remove(): boolean {
    const isDeleted = userService.removeById(this.id);
    return isDeleted;
  }
}

Using resolver informations inside hook function
Arguments passed to resolver are exactly the same, as ones passed to native graphql resolver funtion. Signature of hook function is
(source, arguments, context, info) => void
In case, we'd like to add id of removed user to logs, we'd change our code to:
@ObjectType()
class Person {
  @Field() id: number;

  @Field()
  @After(user => {
    loggingService.sendLog(`User with id ${user.id} was removed`);
    // note we could as well use `this` keyword like:
    // loggingService.sendLog(`User with id ${this.id} was removed`);
  })
  remove(): boolean {
    const isDeleted = userService.removeById(this.id);
    return isDeleted;
  }
}

Notes

If one field has many hooks of the same type - they're executed in parallel.
Field resolver is not called until all @Before hooks are resolved

explore/hooks/guard.html.body:
Guard hooks
Guard hooks are special kind of @Before hook designed to easy control access to some field
Let's say we have User type and we don't want to show isBanned field to anyone. We want only admins to be able to see that.
import { ObjectType, Field, Guard } from 'typegql';

@ObjectType()
class User {
  @Field() name: string;

  @Guard((source, args, context) => context.currentUser.isAdmin, { msg: 'Not allowed' })
  @Field()
  isBanned: boolean;
}

@Guard decorator takes 2 parameters.

First is hook fuction that returns boolean. If hook function returns true - field access is allowed.
2nd argument is options object with error message in case field access is not allowed

createGuard function
In many cases, we need to guard multiple fields with exactly the same rule. createGuard function helps avoiding code repetition in such case.
Let's say we have more User fields we want to show only to admins. We could rewrite above code with:
import { ObjectType, Field, createGuard } from 'typegql';

const OnlyAdmin = createGuard((source, args, context) => context.currentUser.isAdmin, {
  msg: 'Not allowed',
});

@ObjectType()
class User {
  @Field() name: string;

  @OnlyAdmin()
  @Field()
  isBanned: boolean;

  @OnlyAdmin({ msg: 'Not allowed to see this field' }) // we can overwrite guard options defined in `createGuard`
  @Field()
  hasEmailConfirmed: boolean;
}

explore/inject/.body:
Injecting value to resolver
Quite often we need to have access to graphql context inside resolver. Common example could be field like viewer
{
  viewer {
    me {
      username
    }
  }
}

Built-in injectors @Context, @Source, @Info
There are 3 argument decorators in typegql that allow passing values to resolvers - @Context, @Source, @Info
Implementation of Viewer type would use @Context decorator to get user id from graphql context and could look like:
import { ObjectType, Field, Context } from 'typegql';

@ObjectType()
class Viewer {
  @Field({ type: () => Person })
  me(@Context context) {
    return db.findUserById(context.currentUser.id);
  }
  @Field() id: number;
}

Custom injector with @Inject
Beside built-in injectors you can use @Inject decorator to pass any value to given argument.
@Inject decorator requires getter function that converts resolve info to any arbitral value. Note you can return promise of any value, too.
import { ObjectType, Field, Inject } from 'typegql';

@ObjectType()
class Viewer {
  @Field({ type: () => Person })
  me(@Inject({source, args, context, info} => 42) someNumber: number): number {
    return someNumber; // it will be 42;
  }
  @Field() id: number;
}

Notes

Decorated arguments are not present in args list of field schema definition.

explore/union.html.body:
Union types
Considering such query:
{
  search(keyword: "car") {
    ... on Product {
      name
      price
    }
    ... on Category {
      name
      itemsCount
      avgProductPrice
    }
  }
}

Search field return union of Product and Category. To define such union we need to use @Union decorator
import { ObjectType, Field, Union } from 'typegql';

@ObjectType()
class Product {
  @Field() name: string;
  @Field() price: number;
}

@ObjectType()
class Category {
  @Field() name: string;
  @Field() itemsCount: number;
  @Field() avgProductPrice: number;
}

@Union({ types: [Product, Category] })
class SearchResult {}

